import {useContext} from 'react'
import { Boss } from './Puplic'
export default function MiniMapping() {
    const {joky} = useContext(Boss)

  return (
    joky.map(x => 
   <>
    <li key={x.id} className='d-flex justify-content-between align-items-center m-2'
    style={{
        listStyle : 'none'
    }}>
    <div className='bg-danger p-2 rounded text-light'>{x.image}</div>
    <div className='bg-warning p-2 rounded'
    style={{
        width:'200px'
    }}>
    <span className='text-light'>{x.name}</span>
    <span>{x.year}</span>
    </div>
    </li> 
  </>
  ))
    }
